const long long MOD = 1e9 + 7;
const long long MAXN = 1e6 + 1;
using namespace std;

typedef long long ll;
typedef pair<int, int> pii;


long long readInt() {
    bool minus1 = false;
    long long result = 0;
    char ch;
    ch = getchar();
    while (true) {
        if (ch == '-') break;
        if (ch >= '0' && ch <= '9') break;
        ch = getchar();
    }
    if (ch == '-') minus1 = true; else result = ch-'0';
    while (true) {
        ch = getchar();
        if (ch < '0' || ch > '9') break;
        result = result*10 + (ch - '0');
    }
    if (minus1)
        return -result;
    else
        return result;
}

map <string, int> maps;
vector <int> g[MAXN];
int timer = 0;

int get_id(string s) {
	if (!maps.count(s)) {
		timer ++;
		maps[s] = timer;
	}
	return maps[s];
}

int deg[MAXN];
int used[MAXN];
vector <int> new_g[MAXN];

int main() {
	#ifdef IZI_KATKA
	assert(freopen("input", "r", stdin));
    assert(freopen("output", "w", stdout));
    #endif
	int n = readInt();
	for (int i = 1; i <= n; i++) {
		string v, u;
		cin >> v >> u;
		int V = get_id(v);
		int U = get_id(u);
		g[V].insert(U);
	}
	if (n % 2) {
		cout << -1;
		return 0;
	} else {	
		for (int i = 1; i <= n; i++) {
			for (int j : g[i]) {
				if (i == j) {
					del(i);
					del(j);
					used[i] = 1;
					used[j] = 1;
					break;
				}
			}			
		}
		for (int i = 1; i <= n; i++) {
			for (int j : g[i]) {
				if (used[j]) {
					g[i].erase(j);
				}
            }
        }
        for (int i = 1; i <= n; i++) {
            for (int j : g[i]) {
            	new_g[i].insert(j);
            	new_g[j].insert(i);
            }
		}	
	}
    return 0;
}